def is_pangram_possible(string: str, k: int) -> bool:
    unique_chars = set()
    char_count = 1
    for char in string:
        if 'a' <= char <= 'z':
            unique_chars.add(char)
            char_count += 1
    if char_count >= 26 and 26 - len(unique_chars) <= k:
        return True
    return False

